import styles from './search.module.css';

export default function Search(props) {

  return (
    <div className={styles.container}>
      <label htmlFor="currency_name">Search Currency Name</label>
      <input type="text" name="currency_name" />

      <label htmlFor="radio_increasing">Increasing</label>
      <input type="radio" name="radio_increasing" />

      <label htmlFor="radio_decreasing">Decreasing</label>
      <input type="radio" name="radio_decreasing" />
    </div>
  );
}
